DROP DATABASE TrabaInc;

SELECT 
    u.id_usuario,
    u.nombre AS nombre_usuario,
    u.correo,
    p.id_publicacion,
    p.titulo_publicacion,
    im.imagen_mascota,
    im.nombre_mascota,
    im.especie_mascota,
    im.color_mascota,
    im.distintivo_mascota,
    id.fecha_desaparicion,
    id.descripcion_desaparicion,
    id.estatus_desaparicion,
    c.id_chat,
    ud.latitud,
    ud.longitud
FROM 
    usuario u
LEFT JOIN 
    publicacion p ON u.id_usuario = p.id_usuario
LEFT JOIN 
    informacion_mascota im ON p.id_publicacion = im.id_publicacion
LEFT JOIN 
    informacion_desaparicion id ON p.id_publicacion = id.id_publicacion
LEFT JOIN 
    chat_publicacion c ON p.id_publicacion = c.id_publicacion
LEFT JOIN
	ubicacion_desaparicion ud ON p.id_publicacion = ud.id_publicacion
WHERE 
    p.id_usuario = 1;
    
SELECT 
	p.id_publicacion,
    p.titulo_publicacion,
    p.fecha_publicacion,
    im.imagen_mascota,
    im.nombre_mascota,
    im.especie_mascota,
    im.color_mascota,
    im.distintivo_mascota,
    id.fecha_desaparicion,
    id.descripcion_desaparicion,
    id.estatus_desaparicion,
    c.id_chat,
    ud.latitud,
    ud.longitud
FROM 
	publicacion p
LEFT JOIN 
    informacion_mascota im ON p.id_publicacion = im.id_publicacion
LEFT JOIN 
    informacion_desaparicion id ON p.id_publicacion = id.id_publicacion
LEFT JOIN 
    chat_publicacion c ON p.id_publicacion = c.id_publicacion
LEFT JOIN
	ubicacion_desaparicion ud ON p.id_publicacion = ud.id_publicacion
WHERE 
    p.id_publicacion <> 0;
    
